import React from "react";
import Navbar from "../layouts/Navbar";
import PanelBlocs from "../components/PanelBlocs";

export default function Home() {
  return (
    <>
      <div className="flex flex-col h-full  xl:flex-row">
        <div className="xl:w-[17%] w-full">
          <Navbar />
        </div>
        <div className="bg-red-500 xl:w-[83%] w-full py-12 xl:px-16 px-8 flex flex-col ">
          <strong className="px-2 py-6 font-mono text-xl">Panneau de commande</strong>
          <PanelBlocs />
        </div>
      </div>
    </>
  );
}
